import React from 'react';
import './App.css';
import Header from './Header';
import FormBanner from './FormBanner';
import OrderForm from './OrderForm';
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <main>
        <FormBanner />
        <hr />
        <OrderForm />
      </main>
      <Footer />
    </div>
  );
}

export default App;
